import React, { Component } from 'react';
import "./UploadSection.css";
import { Paper, Avatar } from '@material-ui/core';
import live from "../../../../images/video.png";
import image from "../../../../images/image.png";
import feeling from "../../../../images/feelings.png";

class UploadSection extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
        <div>
           <Paper className="upload__container" >
                <div className="upload__top">
                    <div>
                        <Avatar src="https://scontent.fccu3-1.fna.fbcdn.net/v/t1.6435-1/p148x148/162713656_4172696726074274_4057600099221701280_n.jpg?_nc_cat=109&ccb=1-3&_nc_sid=dbb9e7&_nc_ohc=JZF-KE3J5i8AX_bfiWf&_nc_ht=scontent.fccu3-1.fna&tp=6&oh=d777e7f1cac41c18c54d15ddd673033b&oe=608F5148" className="upload_img"/>
                    </div>
                    <div>
                        <input className="upload__box" placeholder="What's on your mind ?" type="text" />
                    </div>
                </div>
                <div  className="upload__bottom">
                    <div className="upload__buttons">
                        <img src={live} width="30px" />
                        <div className="upload__text">Live video</div>
                    </div>
                    <div className="upload__buttons">
                        <img src={image} width="30px" />
                        <span className="upload__text">Photo/Video</span>
                    </div>
                    <div className="upload__buttons">
                        <img src={feeling} width="30px" />
                        <span className="upload__text">Feeling/Activity</span>
                    </div>
                </div>
             </Paper>
        </div> 
        );
    }
}

export default UploadSection;
